import './App.css';
import librarybg from './img/librarybg.jpg';

function Hero() {
  return (
    <div className="hero-box">
      <header>
      <img src={librarybg} className="hero-box-logo" alt="logo" />
        Hello world!
      </header>
    </div>
  );
}

export default Hero;
